import React from 'react';

const DiagnosisPage = () => {
    return (
        <div className="container mx-auto p-4">
            <h1 className="text-2xl font-bold">Diagnosis</h1>
            <p>Upload an image to diagnose plant disease.</p>
        </div>
    );
};

export default DiagnosisPage;
